                    { 3, "Renekton", "First produced in 1996, Renektoy quickly and unexpectedly became the must-have gift of the season. Shortages and heightened demand led to online scalping, parents fist fighting in store aisles, and a small number of what police later described as \"mall stampedes\".", "", 10, "Jouet", 750f },
                    { 4, "Aphelios", "Ionians share whispered stories of the twin spirits of the night, Aphelio and Alune. It is said the darkening of the sky, comes from the brother's armaments, tearing the fabric of blues and whites apart to create an obsidian canvas painted with stars. The sister's motives are more... mysterious.", "", 11, "Fleur spirituelle", 1350f },
