                    { 10, "Annie", "Daughter of the cafe's owner and an accomplished pastry mage wunderkind, Annie has a sweet tooth to be reckoned with. Though her occasional hangry tantrums send her enchanted gummy bear scouring the cafe for any morsel of food fit for her master, with a full belly Annie is as sweet as sugar!", "", 17, "Annie Café Chouchous", 1350f },
                    { 11, "Aurelion Sol", "Pyromancer cultists unwisely summoned the god of fire and ruin—the Ashen Lord—into the world hoping to control his power. Instead, he unleashed his infernal legions to remake all things in his image: cinder, ash, and death.", "", 18, "Seigneur Volcanique", 1350f },
                    { 12, "Aurelion Sol", "Designated ASOL-13, the “Mecha Aurelion Sol” is a gigantic, mobile mothership carrying tens of thousands of personnel, attack fighters, and ground-based anti-kaiju vehicles. Buried within its hull are a vast array of weapons, making ASOL-13 more than a match for even the most gargantuan kaiju.", "", 19, "Mecha", 1350f },
                    { 13, "Aurelion Sol", "The dragon Aurelion Sol, known to seven generations of worshippers as Ao Shin, has long awaited the ascent of a warrior worthy of receiving the power of the storm. Now, with Lee Sin's transformation into the Dragonmancer, Ao Shin has directed his impossible power towards purging the world of evil.", "", 20, "Dragon des Tempêtes", 1350f },
